                for (var i = 0; i < respheadlength; i++) { 
                    var headerName = connection.getHeaderFieldKey(i); 
                    var headerValue = connection.getHeaderField(i); 
                    if (headerName)
                        xhr.responseHeaders[headerName+''] = headerValue+'';
                }
